Διάβασα μόνο για μια κασέτα που βρέθηκε στο σπίτι του Λιγναδή  και γράφει το όνομα του 
Ξέρουμε κάτι άλλο;

#Λιγναδης #Λιγναδης_παιδεραστης #Λιγναδης_gate #Μπαμπινιωτης #Μαρκουλακης

Παίδες ποιος θέλει να πάμε στοίχημα
ότι πρώτος θα ανοίξει τον χορό ο #μαρκουλακης 
που βρέθηκε η βιντεοκασσέτα με το όνομά του στο αρχείο
και μετά θα πάει η #καρυδηεκτοςμεγκα να καταθέσει με το ζόρι;
ή κλέβω εκκλησία;
